import { ImageResponse } from '@vercel/og';
import { NextRequest } from 'next/server';

const base64PoppinsData = '';
const base64SourceSerifData = ''
const base64SourceSerifBoldData = ''
const base64BarlowData = '';

export const config = {
  runtime: 'edge',
};


export default function handler(request: NextRequest) {
  try {
    const { searchParams } = new URL(request.url);

    // ?title=<title>
    const hasTitle = searchParams.has('title');
    const title = hasTitle
      ? searchParams.get('title')?.slice(0, 100)
      : 'Note';
      
    // Extract tags
    const hasTags = searchParams.has('tags');
    const tags = hasTags
      ? searchParams.get('tags')?.split(',').map(tag => `# ${tag.trim()}`) // Assuming tags are passed as a comma-separated string
      : ['# a','# b','# c'];
  
    // Extract content
    const hasContent = searchParams.has('content');
    const content = hasContent
      ? searchParams.get('content')
      : 'No content found.'

    // Extract date
    const hasYear = searchParams.has('yy');
    const dateYear = hasYear ? searchParams.get('yy') : '2024';

    const hasMonthDay = searchParams.has('mmdd');
    const dateMonthDay = hasMonthDay ? searchParams.get('mmdd') : '01/01';
 
    const poppinsData = new Uint8Array(Buffer.from(base64PoppinsData, 'base64')).buffer;
    const sourceSerifData = new Uint8Array(Buffer.from(base64SourceSerifData, 'base64')).buffer;
    const sourceSerifBoldData = new Uint8Array(Buffer.from(base64SourceSerifBoldData, 'base64')).buffer;
    const barlowData = new Uint8Array(Buffer.from(base64BarlowData, 'base64')).buffer;

    return new ImageResponse(
      (
        <div
        style={{
            height: '100%',
            width: '100%',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            backgroundColor: '#1e1e1e',
            backgroundImage: 'linear-gradient(to bottom, #393639 0%, #1e1e1e 40%)',
            fontSize: 32,
            fontWeight: 600,
            color: '#ffd08f',
        }}
        >

        <div style={{
          // width: '700',
          // height: '300',
          // border: '#39363940 5px solid',
        }}>

        </div>

        <div
            style={{
            width: '750',
            display: 'flex',
            alignItems: 'flex-start',
            justifyContent: 'space-between',
            position: 'absolute',
            top: 25,
            left: 25,
            }}
        >
            
            <h4
            style={{
                margin: 0,
                marginTop: 5,
                width: '700',
                overflow: 'hidden',
                alignItems: 'center',
                display: 'block',
                lineClamp: '1 "..."',
                fontFamily: '"Poppins"',
                fontSize: 36,
            }}
            >
                    {title}
            </h4>
            <div
            style={{
                margin: "0",
                fontWeight: '200',
                width: '50',
                display: 'flex',
            }}
            >
                    <img src="https://nonotnotes.com/static/icon.png" height="50" width="50"
                        style={{
                          borderRadius: '10',
                          boxShadow: 'white 0px 0px 10px 5px',
                        }}
                    ></img>
            </div>
        </div>
        <ol style={{
            display: 'flex',
            flexDirection: 'row',
            alignItems: 'flex-end',
            fontSize: '24',
            fontWeight: '800',
            fontFamily: '"SS4Bold"',
            color: '#ffd08f',
            gap: '.4rem',
            margin: '1rem 0',
            paddingLeft: '0',
            listStyle: 'none',
            position: 'absolute',
            left: '25',
            bottom: '5',
        }}
        >
            { tags.map((tag, index) => (
              <li
                key={index}
                style={{
                  backgroundColor: '#302c2c',
                  borderRadius: '8px',
                  margin: '0 .1rem',
                  padding: '.2rem .4rem',
                }}
              >
                { tag }
              </li>
            )) }
        </ol>
        <h6
            style={{
                margin: 0,
                lineHeight: '40px',
                alignItems: 'center',
                display: 'block',
                position: 'absolute',
                bottom: 20,
                right: 25,
                fontFamily: '"Barlow"',
                color: "#ffffff80",
                fontStyle: '',
                fontSize: '25',
            }}
        >
            <span>{dateMonthDay}</span>
            <hr style={{width: `10`, padding: 0, margin: '0.2em', backgroundColor: '#ffffff80'}}/>
            <span>{dateYear}</span>
        </h6>
        <hr style={{width: `5`, height: 250, padding: 0, margin: '0', backgroundColor: '#393639cc', position: 'absolute', left: 25, top: 82}}/>
        <p style={{
          display: 'block',
          fontFamily: 'SS4',
          fontSize: '30',
          position: 'absolute',
          top: 50,
          height: 325,
          width: 800,
          paddingLeft: 50,
          paddingRight: 50,
          maskImage: 'linear-gradient(to bottom, #000000ff 70%, #00000000 100%)',
          color: '#ebe7d7',
          textAlign: 'left',
          wordBreak: 'break-word',
          whiteSpace: 'normal',
        }}
        >
          {content}
        </p>
    </div>
      ),
      {
        width: 800,
        height: 400,
        fonts: [
          {
            name: 'Poppins',
            data: poppinsData,
            weight: 400,
            style: 'normal',
          },
          {
            name: 'SS4',
            data: sourceSerifData,
            weight: 400,
            style: 'normal',
          },
          {
            name: 'SS4Bold',
            data: sourceSerifBoldData,
            weight: 600,
            style: 'normal',
          },
          {
            name: 'Barlow',
            data: barlowData,
            weight: 400,
            style: 'normal',
          }
        ],
        debug: false,
      },
    );
  } catch (e: any) {
    console.log(`${e.message}`);
    return new Response(`Failed to generate the image`, {
      status: 500,
    });
  }
}